import React from 'react';
import {Ul, Img, Atag, H1, H2, Li, Ptag} from '../components/index';
import {Picture, Section} from './index';

const Main = (props) => {
  const media = [
    {
      media: '(min-width: 640px)',
      mediaSrc: './mainvisual-pc.jpg',
    }
    ]
  return (
    <React.Fragment>
      <Picture src={'./mainvisual-sp.jpg'} media={media}/>
      <Section id={'about'} className={'flex flex-col items-center px-5 mt-20 text-sm'}>
        <H2 className={'font-bold text-3xl mb-10'}>
          {'About'}
        </H2>
        <Ul className={'mb-8'}>
          <Li className={'mb-8'}>
            {'Xxxxx Ashley'}
          </Li>
          <Li>
            {'2th Floor xxxxx Building x-x-x Nishiazabu, Minato-ku, Tokyo 106-0031 Japan'}
          </Li>
          <Li>
            {'tel: 000-0000-0000'}
          </Li>
          <Li>
            {'url: www.xxxxxx.jp'}
          </Li>
          <Li>
            {'mail: xxx@xxxxxx.jp'}
          </Li>
        </Ul>
        <Ptag>
          {'プロフィールテキストテキストテキストテキストテキストテキストテキストテキストテキストスト テキストテキストテキストテキストテキストテキストテキストテキストテキストテキストテキスト テキストテキストテキストテキストテキストテキストテキストテキストテキストテキストテキスト'}
        </Ptag>
      </Section>
      <Section id={'works'} className={'flex flex-col items-center px-5 mt-20 text-sm'}>
        <H2 className={'font-bold text-3xl mb-10'}>
          {'Works'}
        </H2>
        <Img src={'./works1.jpg'}></Img>
        <Img src={'./works2.jpg'}></Img>
        <Img src={'./works3.jpg'}></Img>
        <Img src={'./works4.jpg'}></Img>
        <Img src={'./works5.jpg'}></Img>
        <Img src={'./works6.jpg'}></Img>
      </Section>
    </React.Fragment>
  );
}

export default Main;
